class Solution(object):
    def minimumOperationsToMakeEqual(self, x, y):
        from collections import deque
        visited = set()
        queue = deque([(x, 0)])
        while queue:
            current, steps = queue.popleft()
            if current == y:
                return steps
            visited.add(current)
            # Decrement by 1
            if current - 1 not in visited and current - 1 >= 1:
                queue.append((current - 1, steps + 1))
            # Increment by 1
            if current + 1 not in visited and current + 1 <= 104:
                queue.append((current + 1, steps + 1))
            # Divide by 5
            if current % 5 == 0 and current // 5 not in visited:
                queue.append((current // 5, steps + 1))
            # Divide by 11
            if current % 11 == 0 and current // 11 not in visited:
                queue.append((current // 11, steps + 1))
        return -1
